import setFormData from '../services/setFormData';
import getFormData from '../services/getFormData';

const StepMessanger = () => {
    return (
        <div>
            <span>Оставьте заявку, и мы с вами свяжемся</span><br/>
            <span>* Как к вам обращаться?</span>
            <Form
            onSubmit = {onSubmit}
            initialValues = {initialValues}
            render = {({handleSubmit})=>(
                <form onSubmit={handleSubmit}>
                    <Field
                    className = {s.field}
                    name='UserName'
                    component='input'
                    type='text'
                    lable='User Name'
                    variant='outlined'
                    />
                </form>
            )}
            />
            <NavLink to='/stepMessanger'><button type='submit'>Далее</button></NavLink>
        </div>
    );
};
export default StepMessanger;
